plt.show()

# - Sales by month (seasonal trends)
monthly_sales = data.groupby('Month')['Sales'].mean()
plt.figure(figsize=(10, 5))
sns.lineplot(x=monthly_sales.index, y=monthly_sales.values, marker='o')
plt.title('Average Sales by Month')
plt.xlabel('Month')
